I'm trying to write a python code base on group theory to find the order of a group. I'm not sure how to start. Can someone help me?

Here is my code so far:

```
class Group:
    def __init__(self, elements):
        self.elements = elements

    def order(self):
        return len(self.elements)

    def identity(self):
        for element in self.elements:
            if element * element == element:
                return element
        return None

    def inverse(self, element):
        for other_element in self.elements:
            if element * other_element == self.identity():
                return other_element
        return None

    def is_abelian(self):
        for i in range(len(self.elements)):
            for j in range(i+1, len(self.elements)):
                if self.elements[i] * self.elements[j] != self.elements[j] * self.elements[i]:
                    return False
        return True

    def is_group(self):
        if len(self.elements) < 2:
            return False
        if not self.is_abelian():
            return False
        if self.identity() is None:
            return False
        for element in self.elements:
            if self.inverse(element) is None:
                return False
        return True

    def __str__(self):
        return str(self.elements)
```

